import React from 'react';
import Typography from '@material-ui/core/Typography';

function Introduction({name, description}){
    return(
        <div>
            <Typography font-family= 'sans-serif' style={{color: "#fff"}}>
                {name}
            </Typography>
            <br/> 
            <Typography variant = 'subtitle' style={{color: "#fff"}}>
                {description}
            </Typography>

        </div>
    );
}
export default Introduction;
